SELECT ?person WHERE {
  # Part 1: Native of the administration of Alexander II, Grand Duke of Finland
  OPTIONAL {
    ?person <http://dbpedia.org/ontology/birthPlace> ?place .
    ?place <http://dbpedia.org/property/administration> <http://dbpedia.org/resource/Alexander_II,_Grand_Duke_of_Finland> .
  }

  # Part 2: Person decedent at the birthplace of Sandro Bertaggia
  OPTIONAL {
    ?decedent <http://dbpedia.org/ontology/deathPlace> ?deathPlace .
    ?bertaggia rdfs:label "Sandro Bertaggia"@en .
    ?bertaggia <http://dbpedia.org/property/birthPlace> ?birthPlace .
    FILTER (isLiteral(?birthPlace))
    BIND(IRI(CONCAT("http://dbpedia.org/resource/", STR(AFTER(STR(?birthPlace), "http://dbpedia.org/resource/"), "_")))) AS ?countryBirthPlace
    FILTER (?deathPlace = ?countryBirthPlace)
  }

  # Part 3: Native of the administration of Nicholas II of Russia
  OPTIONAL {
    ?person2 <http://dbpedia.org/ontology/birthPlace> ?place2 .
    ?place2 <http://dbpedia.org/property/administration> <http://dbpedia.org/resource/Nicholas_II_of_Russia> .
  }
}

