  # Step 3: Identify Alexander of Württemberg's descendants up to three generations
  ?alexander rdfs:label "Alexander of Württemberg (1804-1881)"@en .
  ?child1 <http://dbpedia.org/ontology/birthPlace> ?place1 ;
           <http://dbpedia.org/ontology/father> ?alexander .
  ?child2 <http://dbpedia.org/ontology/birthPlace> ?place2 ;
           <http://dbpedia.org/ontology/father> ?child1 .
  ?individual <http://dbpedia.org/ontology/birthPlace> ?place3 ;
               <http://dbpedia.org/ontology/father> ?child2 .

  # Combine the conditions
  ?royalChild <http://dbpedia.org/ontology/birthPlace> ?place4 ;
              <http://dbpedia.org/ontology/father> ?parent .
  ?predecessorChild <http://dbpedia.org/ontology/birthPlace> ?place5 ;
                    <http://dbpedia.org/ontology/father> ?predecessor .

  FILTER (?individual = ?royalChild && ?individual = ?predecessorChild)
}

