SELECT ?native WHERE {
  # Step 1: Identify "New York (state)"
  ?award rdfs:label "New York"@en .
  ?award rdf:type <http://dbpedia.org/ontology/Region> ;
         rdf:type <http://dbpedia.org/ontology/Country> ;
         rdf:type <http://dbpedia.org/ontology/State> ;
         rdf:type <http://dbpedia.org/ontology/Settlement> .

  # Step 2: Find natives of New York State
  ?person <http://dbpedia.org/ontology/birthPlace> ?award .

  # Step 3: Identify Coro de la Pontificia Universidad Católica de Puerto Rico's member
  ?coroMember rdfs:label "Coro de la Pontificia Universidad Católica de Puerto Rico"@en ;
              <http://dbpedia.org/ontology/member> ?person .

  # Step 4: Find Bobby Shmurda's birth name
  ?bobbyShmurda rdfs:label "Bobby Shmurda"@en .
  ?bobbyShmurda <http://dbpedia.org/property/birthName> ?birthName .

  # Step 5: Identify GS9's associated musical artist
  ?gs9Member rdf:type <http://dbpedia.org/ontology/MusicalArtist> ;
             rdfs:label "GS9"@en .
  ?gs9Member <http://dbpedia.org/ontology/memberOfBand> ?musicalArtist .

  # Step 6: Find the band member of that musical artist who is also native to New York State
  ?bandMember <http://dbpedia.org/ontology/memberOfBand> ?musicalArtist .
  FILTER(?native = ?person && ?native = ?coroMember && ?native = ?bobbyShmurda && ?native = ?bandMember)
}

