SELECT ?commonChild WHERE {

  # Step 1: Find Constance of Burgundy's royal spouse
  ?spouse rdfs:label "Constance of Burgundy"@en ;
          <http://dbpedia.org/ontology/spouse> ?conSpouse .
  FILTER EXISTS { ?conSpouse a <http://dbpedia.org/ontology/RoyalFamilyMember> } .

  # Step 2 & 3: Find the grandchild of this spouse
  ?conSpouse <http://dbpedia.org/ontology/child> ?child1 ;
             <http://dbpedia.org/ontology/child> ?grandChild .

  # Step 4: Find Roger II of Sicily's royal child
  ?roger2 rdfs:label "Roger II of Sicily"@en ;
          <http://dbpedia.org/ontology/child> ?royalChild .
  FILTER EXISTS { ?royalChild a <http://dbpedia.org/ontology/RoyalFamilyMember> } .

  # Step 5 & 6: Find the child of this royal child's parent
  ?parentOfRoyalChild <http://dbpedia.org/ontology/child> ?royalChild ;
                      <http://dbpedia.org/ontology/child> ?nextGen .

  # Step 7: Identify William II of Sicily's father
  ?william2 rdfs:label "William II of Sicily"@en ;
            <http://dbpedia.org/ontology/father> ?fatherOfWillII .

  # Find commonality between grandchild and next generation
  FILTER (?grandChild = ?nextGen)
  BIND(?grandChild AS ?commonChild)

}

