SELECT ?office ?tenant WHERE {
  # Find the administration where Anxo Quintana was a leader
  ?administration <http://dbpedia.org/ontology/leader> <http://dbpedia.org/resource/Anxo_Quintana> .

  # Determine the office held by Anxo Quintana in that administration
  ?administration <http://dbpedia.org/property/office> ?office .

  # Find tenants of Spain and the identified administration
  OPTIONAL {
    ?tenant <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Spain> .
    ?tenant <http://dbpedia.org/ontology/memberOf> ?administration .

    # Filter by association with the Spanish Socialist Workers' Party
    ?tenant <http://dbpedia.org/property/referenceTo> <http://dbpedia.org/resource/Spanish_Socialist_Workers'_Party> .
  }
}

SELECT ?person WHERE {
  # Part 1: Find Ann Sothern's birth name
  ?v0 <http://dbpedia.org/property/birthName> ?birthName .
  ?v0 rdfs:label "Ann Sothern"@en .

  # Part 2: Find the actor of "1,000 Dollars a Minute" and their spouse
  OPTIONAL {
    ?v1 rdfs:label "1,000 Dollars a Minute"@en .
    ?v1 <http://dbpedia.org/ontology/starring> ?actor .
    ?actor <http://dbpedia.org/property/spouse> ?spouse .
  }

  # Part 3: Find the ruling party at a landmark with elevation ~20.1168 meters
  OPTIONAL {
    ?landmark <http://www.w3.org/2003/01/geo/wgs84_pos#elevation> "20.116800000000001347"^^xsd:float .
    ?landmark <http://dbpedia.org/ontology/rulingParty> ?party .
  }
}

SELECT ?office1, ?tenant, ?office2 WHERE {
  # Office of the leader of Conservative Republican Party (Spain)
  ?party rdfs:label "Conservative Republican Party (Spain)"@en .
  ?leader <http://dbpedia.org/ontology/memberOf> ?party ;
           <http://dbpedia.org/ontology/officeHolder> ?office1 .

  # Tenant of the residence of Alberto Ruiz-Gallardón
  ?person rdfs:label "Alberto Ruiz-Gallardón"@en .
  ?residence <http://dbpedia.org/property/residence> ?person ;
             <http://dbpedia.org/ontology/tenant> ?tenant .

  # Office of the commander in the force of Manuel Pinto da Costa
  ?conflict rdfs:label "Manuel Pinto da Costa"@en .
  ?pinto <http://dbpedia.org/property/memberOfForce> ?conflict ;
         <http://dbpedia.org/ontology/officeHolder> ?office2 .
}

SELECT ?person WHERE {
  # Part 1: Decedent at Sandro Bertaggia's birthplace
  ?bertaggia <http://dbpedia.org/ontology/birthPlace> ?birthCountry .
  ?decedent <http://dbpedia.org/property/deathPlace> ?birthCountry .

  # Part 2: Native of Alexander II's administration and Russian Empire
  ?alexanderII <http://dbpedia.org/ontology/administration> ?administrationPeriod .
  ?native1 <http://dbpedia.org/ontology/nationality> <http://dbpedia.org/resource/Russian_Empire> ;
           <http://dbpedia.org/ontology/placeOfBirth> ?adminPlace .
  ?native2 <http://dbpedia.org/ontology/nationality> <http://dbpedia.org/resource/Russian_Empire> ;
           <http://dbpedia.org/ontology/placeOfBirth> ?adminPlace .

  FILTER(?decedent = ?person || ?native1 = ?person || ?native2 = ?person)
}

SELECT ?war WHERE {
