SELECT ?militaryForce WHERE {
  # Military forces involved in the Battle of Fort Royal
  { 
    <http://dbpedia.org/resource/Battle_of_Fort_Royal> <http://dbpedia.org/ontology/militaryForce> ?militaryForce .
  }

  UNION

  # Awardee of Knight Commander of the Order of the Bath and their associated event or societal event
  {
    ?awardee <http://dbpedia.org/property/knightCommanderOfTheOrderOfTheBath> true .
    ?event rdfs:label ?societalEvent ;
           <http://dbpedia.org/ontology/event> ?awardee .

    # Commander in the war related to "The Triple X's"
    ?war rdfs:label ?militaryConflict ;
         <http://dbpedia.org/property/commander> ?tripleX .
    FILTER regex(?tripleX, "Triple X", "i") .
    ?war <http://dbpedia.org/ontology/militaryForce> ?militaryForce .
  }
}

