SELECT ?result WHERE {
  { 
    ?party <http://dbpedia.org/ontology/type> <http://dbpedia.org/ontology/PoliticalParty> .
    ?party <http://dbpedia.org/ontology/type> <http://dbpedia.org/ontology/Organisation> .
    ?party <http://dbpedia.org/property/rulingPartyIn> <http://dbpedia.org/resource/Westport,_Connecticut> .
    ?member <http://dbpedia.org/ontology/memberOfPoliticalParty> ?party .
    BIND(?member AS ?result)
  }

  UNION

  {
    ?war rdfs:label ?eventLabel .
    FILTER(CONTAINS(LCASE(STR(?eventLabel)), "war") && CONTAINS(LCASE(STR(?eventLabel)), "pickett"))
    ?commander <http://dbpedia.org/ontology/commander> ?war .
    ?commander rdfs:label "George Pickett"@en .
    BIND(?commander AS ?result)
  }
}

