  ?electionEvent dbpedia-owl:date "2003"^^xsd:gYear .
  ?officeHolder dbpedia-owl:election ?electionEvent .

  # Step 2: Get the residences associated with Miguel Maura and Mariano Rajoy
  OPTIONAL {
    ?miguelMaura rdfs:label "Miguel Maura"@en .
    ?miguelMaura <http://dbpedia.org/ontology/residence> ?residence1 .
  }

  OPTIONAL {
    ?marianoRajoy rdfs:label "Mariano Rajoy"@en .
    ?marianoRajoy <http://dbpedia.org/ontology/residence> ?residence2 .
  }

  # Step 3: Find the tenants of these residences
  ?tenant <http://dbpedia.org/ontology/currentResidence> ?residence1 ;
          <http://dbpedia.org/ontology/currentResidence> ?residence2 .
}

