SELECT ?predecessor WHERE {
  # Part 1: Spouse of Saw Min Phyu who is a royalty
  ?spouse rdfs:label "Saw Min Phyu"@en ;
          <http://dbpedia.org/ontology/spouse> ?royalSpouse .

  FILTER EXISTS { ?royalSpouse <http://dbpedia.org/ontology/type> <http://dbpedia.org/ontology/Royalty> }

  # Part 2: Child of this royal spouse
  ?royalSpouse <http://dbpedia.org/ontology/child> ?child .

  # Part 3: Predecessor of this child
  ?child <http://dbpedia.org/ontology/predecessor> ?predecessor .

  UNION

  # Part 4: Father of Myat Hpone Pyo who is a royalty
  ?father rdfs:label "Myat Hpone Pyo"@en ;
          <http://dbpedia.org/ontology/father> ?royalFather .

  FILTER EXISTS { ?royalFather <http://dbpedia.org/ontology/type> <http://dbpedia.org/ontology/Royalty> }

  # Part 5: Spouse of this royal father
  ?royalFather <http://dbpedia.org/ontology/spouse> ?spouseOfRoyalFather .

  # Part 6: Child of Saw Min Hla
  ?sawMinHla rdfs:label "Saw Min Hla"@en ;
             <http://dbpedia.org/ontology/child> ?childOfSawMinHla .

  FILTER (?predecessor = ?spouseOfRoyalFather || ?predecessor = ?childOfSawMinHla)
}

