SELECT ?finalChild WHERE {
  # Step 1: Find parent of Archduchess Margarete Sophie of Austria
  ?parent rdfs:label "Archduke Karl Stephan of Austria"@en .

  # Step 1.5: Find children who are royalty
  ?child <http://dbpedia.org/ontology/birthParent> ?parent ;
         a dbo:RoyalFamilyMember .

  # Step 2: Find spouse of Archduchess Helena of Austria and their child who is royalty
  ?spouse rdfs:label "Archduke Otto of Austria"@en .
  ?royalChild <http://dbpedia.org/ontology/spouse> ?spouse ;
               a dbo:RoyalFamilyMember .

  # Step 3: Find predecessor of the royal child
  ?predecessor <http://dbpedia.org/ontology/successor> ?royalChild .

  # Step 4: Match the child from step 1 with the predecessor from step 3
  ?finalChild <http://dbpedia.org/ontology/birthParent> ?child ;
              owl:sameAs ?predecessor .
}

