SELECT ?alterEgoReference ?childReference WHERE {
  # Step 1: Identify The Shadow's Alter Ego
  ?shadow <http://dbpedia.org/ontology/alternateName> ?alterEgo .
  ?alterEgo rdfs:label "The Shadow"@en ;
            <http://www.w3.org/2002/07/owl#sameAs> ?alterEgoReference .

  # Step 2 & 3: Find the Commander who is Royalty in Siege of Mukha and their Royal Parent
  ?commander rdfs:label "Siege of Mukha"@en ;
             <http://dbpedia.org/ontology/commander> ?royalCommander .
  ?royalCommander <http://dbpedia.org/ontology/nationality> ?royaltyType .
  FILTER(?royaltyType IN (<http://dbpedia.org/resource/Royalty>, <http://dbpedia.org/resource/King>, <http://dbpedia.org/resource/Queen>)) .

  # Find the Royal Parent
  ?royalCommander <http://dbpedia.org/ontology/father> ?parent ;
                  <http://dbpedia.org/ontology/mother> ?parent .
  FILTER(?parent != ?royalCommander) .

  # Step 4: Identify the Child of this Royal Parent
  ?parent <http://dbpedia.org/ontology/child> ?child .
  ?child rdfs:label ?childLabel ;
         <http://www.w3.org/2002/07/owl#sameAs> ?childReference .

}

