  ?commander <http://dbpedia.org/property/commanded> <http://dbpedia.org/resource/Siege_of_Padua> ;
             <http://dbpedia.org/ontology/type> <http://dbpedia.org/ontology/Royalty> .
  ?child <http://dbpedia.org/ontology/father> ?commander .
}

SELECT ?athlete WHERE {
  # Part 1: Athlete born on the same day as Marty Pollio
  ?martyPollio rdfs:label "Marty Pollio"@en .
  ?martyPollio <http://dbpedia.org/ontology/birthDate> ?birthDate .

  ?person rdfs:label ?athleteLabel .
  ?person <http://dbpedia.org/ontology/birthDate> ?sameBirthDate .
  FILTER (YEAR(?sameBirthDate) = YEAR(?birthDate) && MONTH(?sameBirthDate) = MONTH(?birthDate) && DAY(?sameBirthDate) = DAY(?birthDate))
  FILTER EXISTS { ?person a <http://dbpedia.org/ontology/Athlete> }

  # Part 2: Player associated with Sergio Agüero
  OPTIONAL {
    ?aguero rdfs:label "Sergio Agüero"@en .
    ?aguero <http://dbpedia.org/ontology/memberOfTeam> ?team .
    ?player <http://dbpedia.org/ontology/memberOfTeam> ?team .
    FILTER (?player != ?aguero)
  }
}

SELECT ?native ?bandMember WHERE {
  # Step 1: Identify New York City
  <http://dbpedia.org/resource/New_York_City> a dbo:Region ;
    rdf:type dbo:AmericanSettlement, dbo:State .

  # Step 2: Find natives of New York City
  ?person <http://dbpedia.org/ontology/birthPlace> <http://dbpedia.org/resource/New_York_City> .

  # Step 3: Identify Bobby Shmurda's associated musical artist
  ?bobbyShmurda rdfs:label "Bobby Shmurda"@en ;
    dbo:associatedMusicalArtist ?artist .

