SELECT ?finalChild WHERE {
  # Step 1: Find the royal child of Archduke Charles Louis
  ?royalChild <http://dbpedia.org/ontology/birthParent> <http://dbpedia.org/resource/Archduke_Charles_Louis_of_Austria> .
  ?royalChild a <http://dbpedia.org/ontology/RoyalFamilyMember> .

  # Step 2: Find the child of this royal individual
  ?grandchild <http://dbpedia.org/ontology/birthParent> ?royalChild .

  # Step 3: Identify the predecessor of this grandchild
  ?predecessor <http://dbpedia.org/ontology/predecessor> ?grandchild .

  # Step 4: Find the child of Philipp Albrecht, Duke of Württemberg
  ?philippChild <http://dbpedia.org/ontology/birthParent> <http://dbpedia.org/resource/Philipp_Albrecht,_Duke_of_W%C3%BCrttemberg> .

  # Step 5: Find the child of Albrecht, Duke of Württemberg
  ?albrechtChild <http://dbpedia.org/ontology/birthParent> <http://dbpedia.org/resource/Albrecht,_Duke_of_W%C3%BCrttemberg> .

  # Step 6: Match the predecessor with a child from step 4 or 5
  {
    ?finalChild = ?philippChild .
  } UNION {
    ?finalChild = ?albrechtChild .
  }

  FILTER (?predecessor = ?grandchild)
}

