SELECT DISTINCT ?result WHERE {
  # Part 1: Father of William II of Sicily
  ?william2 <http://dbpedia.org/ontology/father> ?fatherOfWilliam2 .

  UNION

  # Part 2: Child of the parent of the child that is a royalty of Roger II of Sicily
  {
    ?childOfRogerII <http://dbpedia.org/ontology/birthPlace> ?place ;
                    <http://dbpedia.org/ontology/father> ?parent .
    ?parent <http://dbpedia.org/ontology/birthPlace> ?grandParentPlace .
    ?grandChildOfGrandParent <http://dbpedia.org/ontology/birthPlace> ?grandParentPlace .
  }

  UNION

  # Part 3: Child of the child of Alfonso VI of León and Castile
  {
    ?childOfAlfonsoVI <http://dbpedia.org/ontology/father> <http://dbpedia.org/resource/Alfonso_VI_of_León_and_Castile> .
    ?grandChildOfAlfonsoVI <http://dbpedia.org/ontology/father> ?childOfAlfonsoVI .
  }

  # Combine results
  VALUES ?result { ?fatherOfWilliam2 ?grandChildOfGrandParent ?grandChildOfAlfonsoVI }
}

