  # Step 2: Traverse three generations to find the great-grandchild
  ?alexander <http://dbpedia.org/ontology/spouse> ?spouse1 ;
             <http://dbpedia.org/ontology/child> ?child1 .
  ?child1 <http://dbpedia.org/ontology/spouse> ?spouse2 ;
          <http://dbpedia.org/ontology/child> ?grandChild1 .
  ?grandChild1 <http://dbpedia.org/ontology/spouse> ?spouse3 ;
               <http://dbpedia.org/ontology/child> ?greatGrandChild .

  # Step 3: Identify Philipp Albrecht's child
  ?philippAlbrecht rdfs:label "Philipp Albrecht, Duke of Württemberg"@en .
  ?philippAlbrecht <http://dbpedia.org/ontology/spouse> ?spouse4 ;
                   <http://dbpedia.org/ontology/child> ?child2 .

  # Step 4: Find the predecessor of Philipp Albrecht's child
  ?predecessor <http://dbpedia.org/ontology/successor> ?child2 .

  # Step 5: Return if the great-grandchild is also a predecessor
  FILTER (?greatGrandChild = ?predecessor)
}

