    ?person <http://dbpedia.org/ontology/birthDate> "1981-12-01"^^<http://www.w3.org/2001/XMLSchema#date> .
    ?person <http://dbpedia.org/ontology/profession> ?role .
    FILTER (
      EXISTS { ?role rdfs:label "Athlete"@en . }
      && EXISTS { ?role rdfs:label "Soccer player"@en . }
      && EXISTS { ?role rdfs:label "Sports manager"@en . }
      && EXISTS { ?role rdfs:label "Soccer manager"@en . }
    )
    ?person <http://dbpedia.org/ontology/player> ?player .
  }

  UNION

  {
    ?manager <http://dbpedia.org/property/teamManaged> <http://dbpedia.org/resource/Hong_Kong_C_Team> .
    FILTER (
      EXISTS { ?role rdfs:label "Sports manager"@en . }
      && EXISTS { ?role rdfs:label "Soccer manager"@en . }
    )
    ?manager <http://dbpedia.org/ontology/player> ?player .
  }
}

