    ?award <http://purl.org/dc/terms/creator> <http://dbpedia.org/resource/Vince_Gilligan> .
    ?recipient <http://purl.org/dc/terms/receiver> ?award .
    ?recipient <http://dbpedia.org/ontology/birthPlace> ?birthPlace .
