    FILTER(STRSTARTS(STR(?v0), "http://dbpedia.org/resource/Myat_Hpone_Pyo"))
  }

  # Spouse of Saw Shwe Khet
  OPTIONAL {
    ?v1 <http://dbpedia.org/property/spouse> ?result .
    FILTER(STRSTARTS(STR(?v1), "http://dbpedia.org/resource/Saw_Shwe_Khet"))
  }

  # Child of the parent of the child of Minye Kyawswa
  OPTIONAL {
    ?v2 <http://dbpedia.org/ontology/child> ?v3 .
    FILTER(STRSTARTS(STR(?v2), "http://dbpedia.org/resource/Minye_Kyawswa"))
    ?v3 <http://dbpedia.org/ontology/parent> ?v4 .
    ?v4 <http://dbpedia.org/ontology/child> ?result .
  }
}

